import React from 'react';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Home from './components/Home';
import SearchResults from './components/SearchResults';
import ApartmentDetails from './components/ApartmentDetails';
import Contact from './components/Contact';
import Apartments from './components/Apartments';
import Apartment1 from './components/Apartment1';
import Apartment2 from './components/Apartment2';
import Apartment3 from './components/Apartment3';
import About from './components/About';
import 'bootstrap/dist/css/bootstrap.min.css';

const App = () => {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/search" element={<SearchResults />} />
        <Route path="/apartment/:id" element={<ApartmentDetails />} />
        <Route path="/apartments" element={<Apartments />} />
        <Route path="/apartment1" element={<Apartment1 />} />
        <Route path="/apartment2" element={<Apartment2 />} />
        <Route path="/apartment3" element={<Apartment3 />} />
        <Route path="/contact" element={<Contact />} />
        <Route path="/about" element={<About />} />
      </Routes>
    </BrowserRouter>
  );
};

export default App;
